</template>

<script setup lang="ts">
import { computed, inject, onUpdated,onMounted, ref, watch } from "vue";
import TileModel from "../Models/TileModel";
import DashboardTilePopup from "./DashboardTilePopup.vue";
import Store from '../store/Store';
import { useRoute } from "vue-router";

let element:HTMLElement
const store: Store = inject('store')!

const emits = defineEmits(['update:data', 'remove']);
let screenWidth = ref();
const clickSetting = ref(false)
let refTileData = ref<TileModel>(new TileModel())
const props = defineProps<{
    url:string
    edit: boolean
    data: TileModel
    id: number
}>()
watch(
  props,
  () => {
    element = document.getElementById(String('tile' + props.id))!
    element!.exec()
  }
)
const tilePosition = {
    "gs-id": props.id,
    "gs-x": props.data.x,
    "gs-y": props.data.y,
    "gs-w": props.data.w,
    "gs-h": props.data.h,
}

onMounted(() => {
    element = document.getElementById(String('tile' + props.id))!
    element!.innerHTML = refTileData.value.script
    element!.setAttribute('type', refTileData.value.chartType)
    element!.exec()
})

function init() {
    refTileData.value = JSON.parse(JSON.stringify(props.data))
    screenWidth.value = window.innerWidth
}

function setting() {
    clickSetting.value = true
}

function remove(id: number) {
    emits('remove', id)
}

function updateData(data: TileModel) {
    refTileData.value = JSON.parse(JSON.stringify(data))
    emits('update:data', data)
    const element = document.getElementById(String('tile' + props.id))
    element!.innerHTML = data.script
    element!.setAttribute('type', data.chartType)
    element!.exec()
}

const warpName = computed(() => {
    if (store.authUser.lang == store.currentProject.l1) {
        return props.data.L1;
    } else if (store.authUser.lang == store.currentProject.l2) {
        return props.data.L2;
    } else if (store.authUser.lang == store.currentProject.l3) {
        return props.data.L3;
    } else {
        return props.data.L1;
    }
})

init()

</script>

<style>
.grid-stack-item-content {
  background-color: v-bind(data.showOutLine ? data.bgColor : 'transparent');
}
</style>
